	app.directive('dMultiline',function() {
		return {			
			restrict: 'A',
			require: 'ngModel',
			scope: {
				bindModel : '=ngModel',
			},
			link: function ($scope, element, attrs) {
				$scope.$watch(
                    function( $scope ) {	
                        if($scope.bindModel){
							return $scope.bindModel;
						}else{
							return "";
						}
                    },
                    function( newValue ) {						
						if(newValue!=""){
							element.html(newValue.replace(/\n/g,"<br>"));
						}
                    }
                );	
			}
		};
	});
	
